import{findUser} from '../store/userActions'
import { useState, useEffect } from 'react';

export function AddToGroup({participants}){

    let participantsObj = []


    cuseEffect(() =>{
        setParticipantsObj(participants)
    },[])

    
    async function setParticipantsObj(participant){
        try{
            const user = await findUser(participant)
            console.log('aviv',user)
            participantsObj.push(user)
    
        }catch(err){}
    }
    
    return <div className='participantsList'>
        {
            participants.forEach(async function(participant){
                try{
                    const user = await findUser(participant)
                    console.log('aviv',user)
                    return <div className='participant' key={participant._id}>{participant.name}</div>
    
                }catch(err){}

            })
        // participants.map((participant) =>{
        //     return <div className='participant' key={participant}>{participant}</div>
        // })
        }
    
    </div>
}
